void drawBackground(struct Screen screen, volatile int pixel_buffer_start, volatile short int* pixel_address) {
  int k = 0;
  int red;
  int green;
  int blue;
  short int p;

  screen.width = screen.x[END] - screen.x[START];

  int screenx;
  int screeny = 0;

  for (int y = screen.y[START]; y < screen.y[END]; y++) {
    screenx = 0;
    for (int x = screen.x[START]; x < screen.x[END]; x++) {
        //k = (y * 320 + x) * 2; // Calculate the index in the startscreen array
        k = (screeny * screen.width + screenx) * 2;
        // Extract RGB values from startscreen
        red = ((screen.array[k + 1] & 0xF8) >> 3) << 11;
        green = (((screen.array[k] & 0xE0) >> 5)) | ((screen.array[k + 1] & 0x7) << 3);
        blue = (screen.array[k] & 0x1f);
        
        // Combine RGB values into a pixel
        p = red | ((green << 5) | blue);
        pixel_address = (short int *)(pixel_buffer_start + (y << 10) + (x << 1));
        *pixel_address= p;
        screenx++;
    }
    screeny++;
  }
  return;
}

void removeBackground(struct Screen screen, volatile int pixel_buffer_start, volatile short int* pixel_address) {

  short int p;

    for (int y = screen.y[START]; y < screen.y[END]; y++) {
    for (int x = screen.x[START]; x < screen.x[END]; x++) {
        p = 0x25de;
        pixel_address = (short int *)(pixel_buffer_start + (y << 10) + (x << 1));
        *pixel_address = p;
    }
  }
  return;
}
